import React, { Component } from 'react';
import { Button, Modal, ModalHeader, ModalBody } from 'reactstrap'

class app extends Component {
    render() {
        return (
            <div class="home">
                <body class="container">
                    <header class="page-header">
                        <h1>Pi carre Login</h1>
                        <a>Home</a>
                    </header>
                    <Button
                        color="warning"
                        onClick={this.toggle}
                        style={{ float: "left", marginRight: "10px" }}>"clique ici si t'es pd (moulino clique)"
                    </Button>
                </body>
            </div>
        )
    }
}
export default app;
